import React, { useState, useRef } from "react";
import { Dialog } from "primereact/dialog";
import { Button } from "primereact/button";
import { InputText } from "primereact/inputtext";
import { Password } from "primereact/password";
import { Toast } from "primereact/toast";
import "../Css/RegistrarCliente.css";


const RegistrarCliente = () => {
  const [visible, setVisible] = useState(false);
  const [formData, setFormData] = useState({
    cedula: "",
    nombre: "",
    primerApellido: "",
    segundoApellido: "",
    direccion: "",
    telefono: "",
    correoElectronico: "",
    contrasena: "",
  });

  const toast = useRef(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = () => {
    // Validación básica
    if (Object.values(formData).some((value) => value.trim() === "")) {
      toast.current.show({
        severity: "warn",
        summary: "Campos vacíos",
        detail: "Por favor, completa todos los campos",
      });
      return;
    }

    // Aquí puedes realizar el envío de datos al backend
    console.log("Datos enviados:", formData);

    // Resetear formulario
    setFormData({
      cedula: "",
      nombre: "",
      primerApellido: "",
      segundoApellido: "",
      direccion: "",
      telefono: "",
      correoElectronico: "",
      contrasena: "",
    });

    toast.current.show({
      severity: "success",
      summary: "Registro exitoso",
      detail: "El usuario se ha registrado correctamente",
    });

    setVisible(false); // Cerrar el modal
  };

  return (
    <div>
      <Toast ref={toast} />
      <Button label="Registrar Usuario" icon="pi pi-user-plus" onClick={() => setVisible(true)} />
      <Dialog
        header="Registro de Usuario"
        visible={visible}
        style={{ width: "50vw" }}
        onHide={() => setVisible(false)}
      >
        <div className="p-fluid">
          <div className="field">
            <label htmlFor="cedula">Cédula</label>
            <InputText id="cedula" name="cedula" value={formData.cedula} onChange={handleInputChange} />
          </div>
          <div className="field">
            <label htmlFor="nombre">Nombre</label>
            <InputText id="nombre" name="nombre" value={formData.nombre} onChange={handleInputChange} />
          </div>
          <div className="field">
            <label htmlFor="primerApellido">Primer Apellido</label>
            <InputText
              id="primerApellido"
              name="primerApellido"
              value={formData.primerApellido}
              onChange={handleInputChange}
            />
          </div>
          <div className="field">
            <label htmlFor="segundoApellido">Segundo Apellido</label>
            <InputText
              id="segundoApellido"
              name="segundoApellido"
              value={formData.segundoApellido}
              onChange={handleInputChange}
            />
          </div>
          <div className="field">
            <label htmlFor="direccion">Dirección</label>
            <InputText id="direccion" name="direccion" value={formData.direccion} onChange={handleInputChange} />
          </div>
          <div className="field">
            <label htmlFor="telefono">Teléfono</label>
            <InputText id="telefono" name="telefono" value={formData.telefono} onChange={handleInputChange} />
          </div>
          <div className="field">
            <label htmlFor="correoElectronico">Correo Electrónico</label>
            <InputText
              id="correoElectronico"
              name="correoElectronico"
              value={formData.correoElectronico}
              onChange={handleInputChange}
            />
          </div>
          <div className="field">
            <label htmlFor="contrasena">Contraseña</label>
            <Password
              id="contrasena"
              name="contrasena"
              value={formData.contrasena}
              onChange={handleInputChange}
              toggleMask
            />
          </div>
          <div className="p-mt-3">
            <Button label="Registrar" icon="pi pi-check" className="p-button-success" onClick={handleSubmit} />
          </div>
        </div>
      </Dialog>
    </div>
  );
};

export default RegistrarCliente;
